import addMatch from '@/components/addMatch';
import addPlayer from '@/components/addPlayer';
import addTeam from '@/components/addTeam';
export default {
  components: {
    addMatch: addMatch,
    addPlayer: addPlayer,
    addTeam: addTeam
  },
  data: function data() {
    return {
      // Direccion de la animacion de despliegue
      direction: 'top',
      // Define si los botones ya vienen desplegados
      fab: false,
      //
      fling: false,
      // Define si seabre con solo hacer hover el elemento
      hover: false,
      //
      tabs: null,
      // Position of the button inside the parent element (recomended a parent element  with height and width defined)
      top: false,
      right: true,
      bottom: true,
      left: false,
      // Animacion X o Y (reverse) en la que los iconos se despliegan
      transition: 'slide-y-reverse-transition'
    };
  },
  computed: {
    activeFab: function activeFab() {
      switch (this.tabs) {
        case 'one':
          return {
            'class': 'purple',
            icon: 'account_circle'
          };

        case 'two':
          return {
            'class': 'red',
            icon: 'edit'
          };

        case 'three':
          return {
            'class': 'green',
            icon: 'keyboard_arrow_up'
          };

        default:
          return {};
      }
    }
  },
  watch: {
    top: function top(val) {
      this.bottom = !val;
    },
    right: function right(val) {
      this.left = !val;
    },
    bottom: function bottom(val) {
      this.top = !val;
    },
    left: function left(val) {
      this.right = !val;
    }
  }
};
